import React, { useContext, useState } from 'react';
import { AuthContext } from '../../contexts/AuthContext';
import './EmployeeDashboard.css';

const EmployeeDashboard = () => {
  const { isAuthenticated } = useContext(AuthContext);

  const [newTask, setNewTask] = useState('');
  const [newTaskLink, setNewTaskLink] = useState('');
  const [tasks, setTasks] = useState([]);

  const handleAddTask = () => {
    if (newTask.trim()) {
      const taskObj = {
        title: newTask,
        status: 'Not Started',
        hours: 0,
        taskLink: newTaskLink,
        feedbackRequested: false,
      };
      setTasks([...tasks, taskObj]);
      setNewTask('');
      setNewTaskLink('');
    }
  }

  const handleStatusChange = (index, status) => {
    const updatedTasks = [...tasks];
    updatedTasks[index].status = status;
    setTasks(updatedTasks);
  }

  const handleHoursChange = (index, hours) => {
    const updatedTasks = [...tasks];
    updatedTasks[index].hours = hours;
    setTasks(updatedTasks);
  }

  const requestFeedback = (index) => {
    const updatedTasks = [...tasks];
    updatedTasks[index].feedbackRequested = true;
    setTasks(updatedTasks);
  }

  return (
    <div className="dashboard-container">
      <h2>Employee Dashboard</h2>

      <div className="task-input">
        <input
          type="text"
          value={newTask}
          onChange={(e) => setNewTask(e.target.value)}
          placeholder="Enter new task"
        />
        <input
          type="text"
          value={newTaskLink}
          onChange={(e) => setNewTaskLink(e.target.value)}
          placeholder="Enter task link"
        />
        <button onClick={handleAddTask}>Add Task</button>
      </div>

      <div className="tasks-grid">
        <table>
          <thead>
            <tr>
              <th>Task Title</th>
              <th>Status</th>
              <th>Hours Spent</th>
              <th>Task Link</th>
              <th>Feedback</th>
            </tr>
          </thead>
          <tbody>
            {tasks.map((task, index) => (
              <tr key={index}>
                <td>{task.title}</td>
                <td>
                  <select
                    value={task.status}
                    onChange={(e) => handleStatusChange(index, e.target.value)}
                  >
                    <option value="Not Started">Not Started</option>
                    <option value="In Progress">In Progress</option>
                    <option value="Done">Done</option>
                  </select>
                </td>
                <td>
                  <input
                    type="number"
                    value={task.hours}
                    onChange={(e) => handleHoursChange(index, e.target.valueAsNumber)}
                    placeholder="Add hours spent"
                  />
                </td>
                <td>
                  <a href={task.taskLink} target="_blank" rel="noopener noreferrer">
                    View Work
                  </a>
                </td>
                <td>
                  {!task.feedbackRequested ? (
                    <button onClick={() => requestFeedback(index)}>
                      Request Feedback
                    </button>
                  ) : (
                    <span>Feedback Requested</span>
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div className="feedback-corner">
        <h3>Supervisor's Feedback</h3>
        <p>
          Excellent work on the XYZ project. Keep it up!
        </p>
      </div>
    </div>
  );
}

export default EmployeeDashboard;
